button.onclick:
// build PDF document
var document = new PdfDocument();
document.getPageSize().setBackgroundColor(new java.awt.Color(250,250,250));
document.open(meibo.getFieldValue(""));
var template = meibo.createPdfView(document, "Report", "Create", meibo.getCurrentDn());
template.scale(70);
document.add(template);
document.close();

// send PDF file to browser
var response = new HttpResponse(document.getMimeType());
response.setAttachmentFile(meibo.getFieldValue("") + ".pdf");
response.append(document.toByteArray());
meibo.setHttpResponse(response);

