var /*Field*/ container= null;
var CONTAINERS_COUNT = 5;

for(var i=2; i<=CONTAINERS_COUNT;i++){
  container = meibo.getField("CONTACT_CONTAINER_" + i);
  if(!container.isVisible()){
    container.show(true);
    if(i==CONTAINERS_COUNT){
      meibo.showField("ADD_CONTACT_BTN",false);
    }
    break;    
  }
}

